 @OCARADAKOMBI  
A paz do senhor Jesus Cristo a todos vou contar algo que aconteceu na minha vida alguns anos atrás fui criado numa igreja evangélica estudei a Bíblia mais não acredito em religião quem me insinuou sobre a bíblia e jesus Cristo foi minha mãe ele ficou muito doente foi internada aí eu tive um sonho que eu chegava no hospital minha mãe entrava em coma e os médicos tiravam minha irmã do quarto guando eu cheguei no hospital os médicos estavam tirando minha irmã do quarto e minha mãe estava entrando em coma minha mãe foi elevada para parte do UTI eu eu comecei ora pela vida dela aí eu tive outra sonho que minha mãe dormiu um sonho muito profundo e minha mãe não acordava 
então eu falava acorda mãe acorda mãe mais ele não acordava ela dormia um sonho muito profundo então uma voz me chamou Daniel Daniel Daniel eu falei o que foi jesus Cristo então ele me respondeu Daniel para você sua mãe está morta para mim ela dormir foi muito difícil para mim perder minha mãe mais jesus Cristo me confortou o tempo todo jesus Cristo abençoe a todos que ler esse testemunho

