 @luugamer1744  E quem está falando de entregar jogo? nossa defesa é a segunda melhor do campeonato do mesmo jeito que ele entregasse, a chances de saírem um gol eram muito pequenas. 
E sobre a questão de não criarem jogadas de gol a resposta está na sua frase, Renato Augusto cansou, Giuliano, Willian etc... 
Esses caras chegaram agora, é normal que no segundo tempo o rendimento caia e ficamos de passes lá atrás, e ainda mais o Bahia tem uma marcação forte, se você assistir o jogo novamente e analisar iria ver que o Willian mal pegava na bola e ja tinham 5 caras marcando ele.

 @luugamer1744  Você deve assistir só os melhores momentos pra falar tanta asneira...
Luan fez várias jogadas com o Adson, além de aparecer bem nas jogadas, obviamente ele não foi o melhor do jogo, mas vocês só sabem criticar e criticar, quando o cara vai um pouco razoável não dão o valor.
Raul kkkkk, nessa temporada ele vai ser vendido, e muito provavelmente usado com um time misto quando estivermos disputando várias competições, espero que ele tenha mais oportunidades no futuro, e o Jô eu não acho que é um imprestável como todos falam, em alguns jogos ele pode ser decisivo entrando no segundo tempo, basta o Sylvinho saber substituir e saber qual o jogo certo para isso.

 @luugamer1744  Você fala de criar jogadas, como se os caras tivessem que se arrastar o jogo inteiro só pra satisfazer torcedores, entendam que eles tem seu tempo físico e ainda não estão 100%, o rendimento sempre vai cair e as armações de jogadas também, principalmente quando o quarteto é substituído.
Vocês precisam ter mais paciência com os jogadores agora, com esse novo time muitos que nunca se deram no elenco podem começar soltar as asas, ai sim poderemos julgar, se o cara não for bem, manda embora, se for pode ser um reserva de ouro.
Não estou defendendo ninguém, apenas dando um questionamento.
